import React from 'react';
import {AppBar, Toolbar, Drawer} from '@mui/material'

export default function Market() {
  return (
  <div>
      <AppBar position="sticky">
        <Toolbar>
          Hello
        </Toolbar>
      </AppBar>
      <Drawer anchor="left" variant="permanent" sx={{flexShrink:0,position: "fixed"}} >
        Hello World
      </Drawer>
      This is the MarketPlace
  </div>
  );
}
